import './App.css';
import Nav from './Nav'
import {BrowserRouter,Routes,Route} from 'react-router-dom'
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Nav/>
          <Routes>
              <Route path="/" element={<h1>Product Listing Component</h1>}></Route>
              <Route path="/add" element={<h1>Add Product  Component</h1>}></Route>
              <Route path="/update" element={<h1>Update Product  Component</h1>}></Route>
              <Route path="/logout" element={<h1>LogOut  Component</h1>}></Route>
              <Route path="/profile" element={<h1>Profile co</h1>}></Route>
          </Routes>

      </BrowserRouter>

    </div>
  );
}

export default App;
